import React, { Component } from "react";

class Header extends Component {
  render() {
    const navbarColor = { backgroundColor: "rgb(198, 240, 240)" };
    return (
      <div className="navbar rounded padding shadow-sm" style={navbarColor}>
        <h1 className="text-black " style={{ padding: 5 }}>
          React App
        </h1>
        <button type="button" class="btn btn-info">plus one</button>
      </div>
    );
  }
}

export default Header;
